  render() {
    // if (this.props.tweet.entities.urls) {
    //   url = this.props.tweet.entities.urls[0].display_url;
    // }
    var linkEnabledColor = null; 
    if (this.props.url != undefined) {
      linkEnabledColor = "blue";
    }

    return (
      <Card color={linkEnabledColor} href={this.props.url} target='_blank'>
        <Card.Content header={this.props.tweet.user.name} />
        <Card.Content description={this.props.tweet.text} />
        <Card.Content extra>
          <Icon name='user' />
          {this.props.tweet.user.followers_count}
        </Card.Content>
      </Card>
    );
  }
}


export default Test;
